import React from 'react';
import './RecValue.css';


const RecValue = (props) => {
    const {concepts} = props;
    function renderData() {
        return props.concepts.map(item =>
            <div key={item.id}>
            <div>
            <p>Ingredients: {item.name}</p>
            <p>Value: {item.value} </p>
            
            </div>
            </div>
            )
    }
        return (
            <div>{renderData()}</div>
            
        )
    }


export default RecValue;
